  render() {
    return <h1>Hi there, {this.props.firstName}!</h1>;
  }
}
export class Button extends React.Component {
  render () {
    return <button >click me</button>;
  }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Greet firstName="Julia" />
    <Button  />
  </React.StrictMode>
);

